SELECT COALESCE("region"."r_regionkey", "region"."r_regionkey") AS "r_regionkey", "region"."r_name", "region"."r_comment", "nation"."n_nationkey", "nation"."n_name", "nation"."n_regionkey", "nation"."n_comment", "supplier"."s_suppkey", "supplier"."s_name", "supplier"."s_address", "supplier"."s_nationkey", "supplier"."s_phone", "supplier"."s_acctbal", "supplier"."s_comment", "t4"."S_SUPPKEY" AS "S_SUPPKEY_", "t4"."S_NAME" AS "S_NAME_", "t4"."TOTAL_REVENUE", "t4"."REVENUE_RANK"
FROM "TPCH"."region"
RIGHT JOIN ("TPCH"."nation" INNER JOIN ("TPCH"."supplier" INNER JOIN (SELECT "t0"."s_suppkey" AS "S_SUPPKEY", "t0"."s_name" AS "S_NAME", SUM("t0"."l_extendedprice" * (1 - "t0"."l_discount")) AS "TOTAL_REVENUE", RANK() OVER (ORDER BY SUM("t0"."l_extendedprice" * (1 - "t0"."l_discount")) DESC NULLS FIRST) AS "REVENUE_RANK"
FROM (SELECT "t"."s_suppkey", "t"."s_name", "t"."s_address", "t"."s_nationkey", "t"."s_phone", "t"."s_acctbal", "t"."s_comment", "t"."ps_partkey", "t"."ps_suppkey", "t"."ps_availqty", "t"."ps_supplycost", "t"."ps_comment", "lineitem"."l_orderkey", "lineitem"."l_partkey", "lineitem"."l_suppkey", "lineitem"."l_linenumber", "lineitem"."l_quantity", "lineitem"."l_extendedprice", "lineitem"."l_discount", "lineitem"."l_tax", "lineitem"."l_returnflag", "lineitem"."l_linestatus", "lineitem"."l_shipdate", "lineitem"."l_commitdate", "lineitem"."l_receiptdate", "lineitem"."l_shipinstruct", "lineitem"."l_shipmode", "lineitem"."l_comment"
FROM "TPCH"."lineitem"
RIGHT JOIN (SELECT "supplier0"."s_suppkey", "supplier0"."s_name", "supplier0"."s_address", "supplier0"."s_nationkey", "supplier0"."s_phone", "supplier0"."s_acctbal", "supplier0"."s_comment", "partsupp"."ps_partkey", "partsupp"."ps_suppkey", "partsupp"."ps_availqty", "partsupp"."ps_supplycost", "partsupp"."ps_comment"
FROM "TPCH"."partsupp"
RIGHT JOIN "TPCH"."supplier" AS "supplier0" ON "partsupp"."ps_suppkey" = "supplier0"."s_suppkey") AS "t" ON "lineitem"."l_partkey" = "t"."ps_partkey") AS "t0"
LEFT JOIN "TPCH"."orders" ON "t0"."l_orderkey" = "orders"."o_orderkey"
GROUP BY "t0"."s_suppkey", "t0"."s_name"
HAVING COUNT(DISTINCT "orders"."o_orderkey") > 5) AS "t4" ON "supplier"."s_suppkey" = "t4"."S_SUPPKEY") ON "nation"."n_nationkey" = "supplier"."s_nationkey") ON "region"."r_regionkey" = "nation"."n_regionkey"